          '<svg aria-hidden="true" class="w-5 h-5 text-blue-600 dark:text-blue-500 rotate-45" fill="none" viewbox="0 0 18 20" xmlns="http://www.w3.org/2000/svg">\n<path d="m9 17 8 2L9 1 1 19l8-2Zm0 0V9" stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2">\n</path>\n</svg>',
      };
      const wrapper = document.getElementById("wrapper");
      Object.keys(svgs).forEach((key) => {
        let svg = svgs[key];
        svg = svg.replace("class=\"", "class=\"scale-800 ");
        //svg = svg.replace(/w-\d+(\.5)?/g, "w-16");
        //svg = svg.replace(/h-\d+(\.5)?/g, "h-16");
        //svg = svg.replace(".5", "")
        wrapper.innerHTML += `<div class="relative w-64 h-64 bg-gray-200">${svg}<input class="w-full text-md rounded-md m-2 p-2 border-2 border-gray-800 name" type="text" name="${key}" /></div>`;
      });
      let names = localStorage.getItem("names");
      if (names != null) {
        names = JSON.parse(names);
      } else {
        names = {};
      }
      let i = 0;
      document.querySelectorAll(".name").forEach((input) => {
        i += 1;
        if(names[input.name] != undefined) {
          input.value = names[input.name];
        }
        input.addEventListener("input", (event) => {
          console.log("Changed", event.target.name, event.target.value);
          names[event.target.name] = event.target.value;
          localStorage.setItem("names", JSON.stringify(names));
        });
      });
      console.log("Listening for changes to ", i, "elements");
    </script>
    <div class="border-4 border-gray-800 rounded-md p-4"></div>
